import React from "react";
import { NavLink } from "react-router-dom";

function Navbar() {
  return (
    <div>
      <div>Logo</div>
      <nav>
        <NavLink to="mclezzetleri">McDONALD'S LEZZETLERİ</NavLink>
        <NavLink to="kampanyalar">KAMPANYALAR</NavLink>
        <NavLink to="hakkimizda">HKKIMIZDA</NavLink>
        <NavLink to="bulezzet">BU LEZZETE GÜVEN</NavLink>
        <NavLink to="restoranlar">RESTORANLAR</NavLink>
        <NavLink to="odullerim">MyMcDonald’s Ödüllerim</NavLink>
        <NavLink to="parti">Doğum Günü Partisi</NavLink>
      </nav>
      <div></div>
      <div></div>
    </div>
  );
}

export default Navbar;
